Symbol数据类型
什么事Symbol
symbol是一种新的数据类型，表示独一无二的值。
通过Symbol()函数来生成Symbol数据
{
    let s1 = Symbol();
    let s2 = Symbol();

    console.log(s1 === s2);        //false

    let s3 = Symbol('foo');
    let s4 = Symbol('foo');

    console.log(s3 === s4);        //false

    console.log(s3.toString());    //Symbol(foo)

