Promise

什么是异步
Promise的作用
Promise的基本用法

Promise是异步编程的一种解决方案，比传统的解决方案--回调函数和事件--更强大。
Promise 基本用法
Es6中，Promise对象是一个构造函数，用来生成Promise实例。
//ES5实现异步是通过回调函数
{
    let ajax = function (callback) {
